class Solution(object):
    def makeFancyString(self, s):
        """
        :type s: str
        :rtype: str
        given a string check for consecutive 3 characters are equal or not 
        """
        first_previous_character = ''
        second_previous_character = ''
        result = []
        for i in s:
            if i == first_previous_character and i == second_previous_character:
                continue
            else:
                result.append(i)
            second_previous_character = first_previous_character
            first_previous_character = i
        return "".join(result)
    
solution = Solution()
test_string = """

"""
print(solution.makeFancyString(test_string)) # leetcode
       